import Axios from 'axios';
import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState(null); 

  useEffect(() => {
    Axios.get("https://api.themoviedb.org/3/movie/550?api_key=721e6d30945061e57c30f65c44877cf8")
    .then(response => {
      console.log(response.data); 
      setMovies(response);
    })
  }, [])
  return movies !== null ? (
    <div className="App">
        {/* <p>{movies.original_title}</p> */}
        <img src = {movies.backdrop_path} alt = "picture movie" />

    </div>
  ):(
    <p>Pas de data</p>
  )
}

export default App;
